import React, { useEffect, useState } from "react";

import Layout from "../components/Layout";
import Card from "../components/Card";
import { PopupWidget } from "react-calendly";
import { collection, addDoc, getDocs } from "firebase/firestore";
import firedb from "../firebaseConfig";
import { fireProducts } from "../fireProducts";

function Home() {


  const [products, setroducts] = useState([]);

  useEffect(() => {
    getData()


  }, [])







  async function addData() {

    try {
      await addDoc(collection(firedb, "users"), { name: "Safwan", age: "18" });


    } catch (error) {
      console.log(error);

    }
  }


  async function getData() {

    try {
      const users = await getDocs(collection(firedb, "products"),);
      const productsArray = [];
      users.forEach((doc) => {

        const obj = {
          id: doc.id, ...doc.data()
        };
        productsArray.push(obj);
      });


      console.log(productsArray);

    } catch (error) {
      console.log(error);

    }
  }










  return (


    <Layout>












      <div className="container">
        <div className="row">

          {
            products.map((product) => {
              return <div className="col-md-4">
                <div className="m-2 p-1">
                  <h3>{product.name}</h3>
                  <img src={product.imageURL} alt="" className="product img" />

                </div>

              </div>

            }
            )
          }


        </div>

      </div>












      <button onClick={addData}> Add here</button>
      <button onClick={getData}> Get here</button>


      <PopupWidget
        url="https://calendly.com/aislamchy96/march-availity"

        rootElement={document.getElementById("root")}
        text="Book Your time !"
        textColor="#ffffff"
        color="#00a2ff"
      />







    </Layout>
  );
}

export default Home;
